import  { FC } from 'React';
import styled from 'styled-components';

import { Wrapper } from '../../styledHelpers/Components';
import { Colors } from '../../styledHelpers/colors';
const LeftPanel = styled.div`
width:300px;
height:300px;
background-color: #6363d1;


`;
const TopPanel = styled.div`
height:150px;
width:300px;
background-color: green;
outline-style: outset;
outline-color: black;
clear: both;
`;
const MidPanel = styled.div`
height: 50px;
width:300px;
background-color: brown;
text-align: left;
outline-style: outset;
outline-color: black;
clear: both;

`;

const ProfIcon = styled.div`
`;
const PubICon = styled.div`
padding-top:10px;
`;
const EcoICon = styled.div`
padding-top:10px;
`;
const EntIcon = styled.div`
padding-top:10px;
`;
const BottomPanel = styled.div`
`;
export const LeftMenu: FC = () => {
    return (
        <LeftPanel>
            <TopPanel>
                <ProfIcon>
                    <img src="./media/icons" alt=""></img>
                </ProfIcon>
            </TopPanel>
            <MidPanel>
                <div>
                    <img src="./media/icons/network.png" alt=""></img>
                    <label>Your network</label>
                    <img src="./media/icons/user-plus.png" alt=""></img>
                </div>
                <div>
                    <img src="./media/icons/publications.png" alt=""></img>
                    <label>Your network</label>
                    <img src="./media/icons/plus.png" alt=""></img>
                </div>

            </MidPanel>
            <BottomPanel>
                <PubICon>
                    <img src="./media/icons/publications.png" alt=""></img>
                    <a href= "dsadasd" style={{padding:"10px"}}  >ssdassss</a>
                </PubICon>
                <EcoICon>
                    <img src="./media/icons/ecosystem.png" alt=""></img>
                </EcoICon>
                <EntIcon>
                    <img src="./media/icons/entities.png"alt=""></img>
                </EntIcon>

            </BottomPanel>
        </LeftPanel>
    );
};
